import sys

def solve_one(s: str) -> str:
    cnt0 = s.count('0')
    cnt2 = s.count('2')
    # find first '2' position
    first2 = s.find('2')
    if first2 == -1:
        # no '2's: we can move all '0's to front
        return '0'*cnt0 + s.replace('0','')
    # count '1's before first '2'
    ones_before = s[:first2].count('1')
    # build result: zeros, those ones, then remaining chars excluding zeros and those ones moved
    res = []
    res.append('0'*cnt0)
    res.append('1'*ones_before)
    # now append remaining characters in original order, skipping zeros and the ones_before number of '1's from prefix
    skip_ones = ones_before
    for ch in s:
        if ch == '0':
            continue
        if ch == '1' and skip_ones > 0:
            skip_ones -= 1
            continue
        res.append(ch)
    return ''.join(res)

def main():
    data = sys.stdin.read().strip().split()
    if not data:
        return
    outputs = []
    # if single token and contains newlines? Problem examples show list; handle all tokens as separate testcases
    for token in data:
        outputs.append(solve_one(token))
    sys.stdout.write("\n".join(outputs))

if __name__ == "__main__":
    main()
